import './styles.css';
import {Swiper, SwiperSlide} from 'swiper/react';
import SwiperCore from 'swiper';
import 'swiper/swiper-bundle.esm.browser';

function App() {

  const slides = [];

  for (let i = 0; i < 5; i+= 1) {
    slides.push(
      <SwiperSlide key={'slide-${i}'}>
        <img
        src = {'https://picsum.photos/id${i + 1}/500/300'}
        alt = {'Slide ${i}'}
        />
      </SwiperSlide>
    )
  }

  return (
    <div className="App">
      <header className="App-header">
       <Swiper id='main'>
       {slides}
       </Swiper>

      </header>
    </div>
  );
}

export default App;
